        private static int LenghtOfLongestSubstring(string s)
        {
            int maxLength = 0;
            HashSet<char> set = new HashSet<char>();
            int i=0;
            int j=0;
            while (j<s.Length)
            {
                if (!set.Contains(s.ElementAt(j))){
                    set.Add(s.ElementAt(j));
                    j++;
                    maxLength = Math.Max(maxLength, j - i);
                } else
                {
                    set.Remove(s.ElementAt(i));
                    i++;
                }
            }
            return maxLength;
        }
